import React from "react";
import { Route,Routes } from "react-router-dom";
// import Contact from "./Contact";
import Home from "./Home";

function AppCpy(){

    return (
        <>
        <Routes>
            <Route path={'/'} element={<Home/>} />
        </Routes>
        </>
    )
}
export default AppCpy;
